	  Grid.prototype.processRowBuilders = function processRowBuilders(gridRow) {
	    var self = this;

	    self.rowBuilders.forEach(function (builder) {
	      builder.call(self, gridRow, self.options);
	    });

	    return gridRow;
	  };

